import React from 'react';

function Home() {
    return (
        <div>
            <h1>Welcome to sleep&see</h1>
            <p>a site made to record and visualize your sleep</p>
            <Link to="/login">
                <button>Posts</button>
            </Link>
        </div>
    );
}

export default Home;
